    public static List<CandleEntry> getCandleEntries(List<BtcData> btcDataList) {
        return getCandleEntries(btcDataList, 0);
    }

    public static List<BarEntry> getBarEntries(List<BtcData> btcDataList) {
        return getBarEntries(btcDataList, 0);
    }

    public static List<Entry> getCloseMaEntries(List<BtcData> btcDataList, int count) {
        List<Entry> list = new ArrayList<>();
        count--;
        for (int i = 0; i < btcDataList.size(); i++) {
            if (i >= count) {
                float average = closeAverage(i - count, i, btcDataList);
                list.add(new Entry(i, average));
            }
        }
        return list;
    }

    public static List<Entry> getMaVolumeEntries(List<BtcData> btcDataList, int count) {
        List<Entry> list = new ArrayList<>();
        count--;
        for (int i = 0; i < btcDataList.size(); i++) {
            if (i >= count) {
                float average = volumeAverage(i - count, i, btcDataList);
                list.add(new Entry(i, average));
            }
        }
        return list;
    }


    /**
     * 计算收盘价的移动平均线
     *
     * @param first
     * @param second
     * @param btcDataList
     * @return
     */
    private static float closeAverage(int first, int second, List<BtcData> btcDataList) {
        float sum = 0.f;
        for (int i = first; i <= second; i++) {
            sum += btcDataList.get(i).getClose();
        }
        return sum / (second - first + 1);
    }

    /**
     * 计算成交量的移动平均线
     *
     * @param first
     * @param second
     * @param btcDataList
     * @return
     */
    private static float volumeAverage(int first, int second, List<BtcData> btcDataList) {
        float sum = 0.f;
        for (int i = first; i <= second; i++) {
            sum += btcDataList.get(i).getVolume();
        }
        return sum / (second - first + 1);
    }

    private static List<CandleEntry> getCandleEntries(List<BtcData> rawData,
                                                      int startIndex) {
        List<CandleEntry> entries = new ArrayList<>();
        for (int i = 0; i < rawData.size(); i++) {
            // public CandleEntry(int xIndex, float shadowH, float shadowL, float open, float close) {
            BtcData btcData = rawData.get(i);
            //CandleEntry的参数：x表示x坐标，shadowH表示影线的最大值，shadowL表示影线的最小值，open表示开盘价，close表示收盘价
            CandleEntry entry =
                    new CandleEntry(startIndex + i, btcData.getHigh(), btcData.getLow(), btcData.getOpen(),
                            btcData.getClose());
            entries.add(entry);
        }

        return entries;
    }

    private static List<BarEntry> getBarEntries(List<BtcData> rawData, int startIndex) {
        List<BarEntry> entries = new ArrayList<>();
        for (int i = 0; i < rawData.size(); i++) {
            //                public CandleEntry(int xIndex, float shadowH, float shadowL, float open, float close) {
            BtcData btcData = rawData.get(i);
            if (btcData == null) {
                Log.e("xxx", "第" + i + "StockBean==null");
                continue;
            }
            BarEntry entry = new BarEntry(startIndex + i, btcData.getVolume());
            entries.add(entry);
        }

        return entries;
    }

